import { theme } from "../../config";

export const BgDivider = () => {
  return (
    <section
      style={{
        marginTop: theme.spacing(5),

        height: "60vh",
        background: `url(/yensaodatquang/assets/img/xay-nha-yen.JPG)`,
        backgroundPosition: "center",
        backgroundSize: "corver",
      }}
    ></section>
  );
};
